import './App.css';
import Paginas from './components/Paginas';
import data from './db.json'

function App() {
  return (
    <div>
      {data.map((empresa)=>{
        <input>{empresa.cliente}</input>
      })}
      <Paginas />
    </div>
  );
}

export default App;
